  [],\n\t\"revision_timestamp\": \"2015-05-06T21:00:50.860219\",\n\t\"name\": \"automated-radiation-measurements-for-aviation-safety-armas-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The existing state-of-the-art for physics-based,
  data-driven, climatological specification of the global radiation environment is
  the capability embodied by Nowcast of Atmospheric Ionizing Radiation for Aviation
  Safety (NAIRAS) and supported by the validation activity in the Automated Radiation
  Measurements for Aviation Safety (ARMAS) project Phase I. In Phase II the ARMAS
  team will: i) integrate, fly, and operate two micro dosimeters on aircraft; ii)
  validate and calibrate the micro dosimeters with a tissue equivalent proportional
  counter; iii) retrieve the micro dosimeter dose and dose rate data in real-time
  via an automated downlink system; iv) use the dose and dose rate measurements in
  a data assimilation algorithm to correct the NAIRAS model dose and dose rate output
  along the flight track; and v) report the corrected dose and dose rate via server,
  web, Google Earth, and smart phone apps for aviation safety.\",\n\t\"license_title\":
